import React from 'react';

const DashboardPage = () => {
  return (
    <div>
      <h1>Welcome to AdStocks Dashboard</h1>
      <p>Manage your stocks and advertising strategies efficiently.</p>
    </div>
  );
};

export default DashboardPage;
